import React from "react";
import PhoneItem from "./PhoneItem";

function PhoneList(props) {
    return (
        <div>
            <h2 style={{textAlign: 'center'}}>Phones</h2>
            {props.phones.map(phone => 
                <PhoneItem phone={phone} key={phone.id}/>
            )}
        </div>
    );
}

export default PhoneList;
